import React from 'react';
import {Link } from 'react-router-dom'; 
import '../styles/Navbar.css';
import menuicon from'../assets/icons8-menu-30.png'
function navbar() {
  return (
    <div className="Navbar">
       <nav className='Nav'>
       <h2><Link to='/'> chatboty</Link></h2> 
        <div className='Navigation-links'>
          
            <ul>
           <li></li> <Link to='/' style={{marginRight:'16px' , color:'white'}}>Home</Link>
      <Link to='/'style={{marginRight:'16px', color:'white'}}>ContactUs</Link>
      <Link to='/' style={{color:'white'}}>AboutUs</Link>
            </ul>
             </div>
 
             
       </nav>
    
    </div>
  )
}

export default navbar
